import { makeStyles } from '@mui/styles';


export const useStyles = makeStyles({
    root: {
        maxWidth: "100%",
        // background: "#009BAD !important",
        color: "#ffffff !important",
        height: "150px",
        marginTop: "20px",
        marginBottom: "20px",


    },
    box: {
        border: "1px solid gray",
        height: "100px",
        width: "100%",
        backgroundColor: "gray",
        margin: "20px",
    }



});
